export class session{
    isSessionSelected : boolean;
    sessionId : string;
    sessionName : string;
    sessionTime : string

    constructor (){
        this.isSessionSelected = false;
        this.sessionId  = "";
        this.sessionName ="";
        this.sessionTime = "";
    }

    static getAllSessions(): session[] {
        return [
          { sessionId: '0', title: 'Student', isSelected: false },
          { sessionid: '1', title: 'Faculty', isSelected: false },
          { id: '2', title: 'Professional', isSelected: false },
        ];
      }

}
